import{_ as e,c as d,o,ag as a}from"./chunks/framework.Ds6Eueu6.js";const h=JSON.parse('{"title":"pg_type","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/system_catalogs/pg_type.md","filePath":"docs/7x/ref_guide/system_catalogs/pg_type.md"}'),r={name:"docs/7x/ref_guide/system_catalogs/pg_type.md"};function s(n,t,c,i,p,y){return o(),d("div",null,t[0]||(t[0]=[a('<h1 id="pg-type" tabindex="-1">pg_type <a class="header-anchor" href="#pg-type" aria-label="Permalink to &quot;pg_type&quot;">â€‹</a></h1><p>The <code>pg_type</code> system catalog table stores information about data types. Base types (scalar types) are created with <code>CREATE TYPE</code>, and domains with <code>CREATE DOMAIN</code>. A composite type is automatically created for each table in the database, to represent the row structure of the table. It is also possible to create composite types with <code>CREATE TYPE AS</code>.</p><table tabindex="0"><thead><tr><th>column</th><th>type</th><th>references</th><th>description</th></tr></thead><tbody><tr><td><code>oid</code></td><td>oid</td><td></td><td>Row identifier (hidden attribute; must be explicitly selected)</td></tr><tr><td><code>typname</code></td><td>name</td><td></td><td>Data type name</td></tr><tr><td><code>typnamespace</code></td><td>oid</td><td>pg_namespace.oid</td><td>The OID of the namespace that contains this type</td></tr><tr><td><code>typowner</code></td><td>oid</td><td>pg_authid.oid</td><td>Owner of the type</td></tr><tr><td><code>typlen</code></td><td>smallint</td><td></td><td>For a fixed-size type, <code>typlen</code> is the number of bytes in the internal representation of the type. But for a variable-length type, <code>typlen</code> is negative. <code>-1</code> indicates a &#39;varlena&#39; type (one that has a length word), <code>-2</code> indicates a null-terminated C string.</td></tr><tr><td><code>typbyval</code></td><td>boolean</td><td></td><td>Determines whether internal routines pass a value of this type by value or by reference. <code>typbyval</code>had better be false if <code>typlen</code> is not 1, 2, or 4 (or 8 on machines where Datum is 8 bytes). Variable-length types are always passed by reference. Note that <code>typbyval</code> can be false even if the length would allow pass-by-value.</td></tr><tr><td><code>typtype</code></td><td>char</td><td></td><td><code>b</code> for a base type, <code>c</code> for a composite type, <code>d</code> for a domain, <code>e</code> for an enum type, <code>p</code> for a pseudo-type, or <code>r</code> for a range type. See also <code>typrelid</code> and <code>typbasetype</code>.</td></tr><tr><td><code>typcategory</code></td><td>char</td><td></td><td>Arbitrary classification of data types that is used by the parser to determine which implicit casts should be preferred. See <a href="#typcategory">Category Codes</a>.</td></tr><tr><td><code>typispreferred</code></td><td>boolean</td><td></td><td>True if the type is a preferred cast target within its <code>typcategory</code></td></tr><tr><td><code>typisdefined</code></td><td>boolean</td><td></td><td>True if the type is defined, false if this is a placeholder entry for a not-yet-defined type. When false, nothing except the type name, namespace, and OID can be relied on.</td></tr><tr><td><code>typdelim</code></td><td>char</td><td></td><td>Character that separates two values of this type when parsing array input. Note that the delimiter is associated with the array element data type, not the array data type.</td></tr><tr><td><code>typrelid</code></td><td>oid</td><td>pg_class.oid</td><td>If this is a composite type (see <code>typtype</code>), then this column points to the <code>pg_class</code> entry that defines the corresponding table. (For a free-standing composite type, the <code>pg_class</code> entry does not really represent a table, but it is needed anyway for the type&#39;s <code>pg_attribute</code> entries to link to.) Zero for non-composite types.</td></tr><tr><td><code>typelem</code></td><td>oid</td><td>pg_type.oid</td><td>If not <code>0</code> then it identifies another row in <code>pg_type</code>. The current type can then be subscripted like an array yielding values of type <code>typelem</code>. A &quot;true&quot; array type is variable length (<code>typlen</code> = <code>-1</code>), but some fixed-length (<code>typlen</code> &gt; <code>0</code>) types also have nonzero <code>typelem</code>, for example <code>name</code> and <code>point</code>. If a fixed-length type has a <code>typelem</code> then its internal representation must be some number of values of the <code>typelem</code> data type with no other data. Variable-length array types have a header defined by the array subroutines.</td></tr><tr><td><code>typarray</code></td><td>oid</td><td>pg_type.oid</td><td>If not 0, identifies another row in <code>pg_type</code>, which is the &quot;true&quot; array type having this type as its element. Use <code>pg_type.typarray</code> to locate the array type associated with a specific type.</td></tr><tr><td><code>typinput</code></td><td>regproc</td><td>pg_proc.oid</td><td>Input conversion function (text format)</td></tr><tr><td><code>typoutput</code></td><td>regproc</td><td>pg_proc.oid</td><td>Output conversion function (text format)</td></tr><tr><td><code>typreceive</code></td><td>regproc</td><td>pg_proc.oid</td><td>Input conversion function (binary format), or 0 if none</td></tr><tr><td><code>typsend</code></td><td>regproc</td><td>pg_proc.oid</td><td>Output conversion function (binary format), or 0 if none</td></tr><tr><td><code>typmodin</code></td><td>regproc</td><td>pg_proc.oid</td><td>Type modifier input function, or 0 if the type does not support modifiers</td></tr><tr><td><code>typmodout</code></td><td>regproc</td><td>pg_proc.oid</td><td>Type modifier output function, or 0 to use the standard format</td></tr><tr><td><code>typanalyze</code></td><td>regproc</td><td>pg_proc.oid</td><td>Custom <code>ANALYZE</code> function, or 0 to use the standard function</td></tr><tr><td><code>typalign</code></td><td>char</td><td></td><td>The alignment required when storing a value of this type. It applies to storage on disk as well as most representations of the value inside WarehousePG. When multiple values are stored consecutively, such as in the representation of a complete row on disk, padding is inserted before a datum of this type so that it begins on the specified boundary. The alignment reference is the beginning of the first datum in the sequence. Possible values are: <br><br><code>c</code> = char alignment (no alignment needed).<br><br><code>s</code> = short alignment (2 bytes on most machines).<br><br><code>i</code> = int alignment (4 bytes on most machines).<br><br><code>d</code> = double alignment (8 bytes on many machines, but not all).</td></tr><tr><td><code>typstorage</code></td><td>char</td><td></td><td>For varlena types (those with <code>typlen</code> = -1) tells if the type is prepared for toasting and what the default strategy for attributes of this type should be. Possible values are:<br><br><code>p</code>: Value must always be stored plain.<br><br><code>e</code>: Value can be stored in a secondary relation (if relation has one, see <code>pg_class.reltoastrelid</code>).<br><br><code>m</code>: Value can be stored compressed inline.<br><br><code>x</code>: Value can be stored compressed inline or stored in secondary storage.<br><br>Note that <code>m</code> columns can also be moved out to secondary storage, but only as a last resort (<code>e</code> and <code>x</code> columns are moved first).</td></tr><tr><td><code>typnotnull</code></td><td>boolean</td><td></td><td>Represents a not-null constraint on a type. Used for domains only.</td></tr><tr><td><code>typbasetype</code></td><td>oid</td><td>pg_type.oid</td><td>Identifies the type that a domain is based on. Zero if this type is not a domain.</td></tr><tr><td><code>typtypmod</code></td><td>integer</td><td></td><td>Domains use <code>typtypmod</code> to record the <code>typmod</code> to be applied to their base type (-1 if base type does not use a <code>typmod</code>). -1 if this type is not a domain.</td></tr><tr><td><code>typndims</code></td><td>integer</td><td></td><td>The number of array dimensions for a domain over an array (if <code>typbasetype</code> is an array type). Zero for types other than domains over array types.</td></tr><tr><td><code>typcollation</code></td><td>oid</td><td>pg_collation.oid</td><td>Specifies the collation of the type. Zero if the type does not support collations. The value is <code>DEFAULT_COLLATION_OID</code> for a base type that supports collations. A domain over a collatable type can have some other collation OID if one was specified for the domain.</td></tr><tr><td><code>typdefaultbin</code></td><td>pg_node_tree</td><td></td><td>If not null, it is the <code>nodeToString()</code> representation of a default expression for the type. This is only used for domains.</td></tr><tr><td><code>typdefault</code></td><td>text</td><td></td><td>Null if the type has no associated default value. If <code>typdefaultbin</code> is not null, <code>typdefault</code> must contain a human-readable version of the default expression represented by <code>typdefaultbin</code>. If <code>typdefaultbin</code> is null and <code>typdefault</code> is not, then <code>typdefault</code> is the external representation of the type&#39;s default value, which may be fed to the type&#39;s input converter to produce a constant.</td></tr><tr><td><code>typacl</code></td><td>aclitem[]</td><td></td><td>Access privileges; see <a href="./../sql_commands/GRANT.html">GRANT</a> and <a href="./../sql_commands/REVOKE.html">REVOKE</a> for details.</td></tr></tbody></table><p>The following table lists the system-defined values of <code>typcategory</code>. Any future additions to this list will also be upper-case ASCII letters. All other ASCII characters are reserved for user-defined categories.</p><table tabindex="0"><thead><tr><th>Code</th><th>Category</th></tr></thead><tbody><tr><td>A</td><td>Array types</td></tr><tr><td>B</td><td>Boolean types</td></tr><tr><td>C</td><td>Composite types</td></tr><tr><td>D</td><td>Date/time types</td></tr><tr><td>E</td><td>Enum types</td></tr><tr><td>G</td><td>Geometric types</td></tr><tr><td>I</td><td>Network address types</td></tr><tr><td>N</td><td>Numeric types</td></tr><tr><td>P</td><td>Pseudo-types</td></tr><tr><td>R</td><td>Range types</td></tr><tr><td>S</td><td>String types</td></tr><tr><td>T</td><td>Timespan types</td></tr><tr><td>U</td><td>User-defined types</td></tr><tr><td>V</td><td>Bit-string types</td></tr><tr><td>X</td><td><code>unknown</code> type</td></tr></tbody></table><p><strong>Parent topic:</strong> <a href="./../system_catalogs/catalog_ref-html.html">System Catalogs Definitions</a></p>',6)]))}const f=e(r,[["render",s]]);export{h as __pageData,f as default};
